?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Наверняка, каждый человек, которые интересуется часовым искусством, не раз слышал о Jaquet Droz. И это неудивительно. Этот человек смог создать свою мануфактуру в 17-летнем возрасте. После создания мануфактуры, он занимался исключительно настенными часами и их механизмами. Но огромная популярность к нему пришла отнюдь не из-за часов. Он просто гениально создавал, так называемые, автоматоны (машина со сложнейшим механизмом, которая способна совершать какие-либо действия). Такие устройства сохранились до сих пор, и увидеть их можно в музее Невшателя. Причем эти самые автоматоны по праву признаны самыми первыми в мире компьютерами. После смерти гениального часовщика, его дело было передано сыну. После этого, часовые механизмы стали совершенствоваться с каждым днем. Сейчас компания производит наручные и карманные часы, причем, и мужские и женские коллекции отличаются своей уникальностью. Большинство корпусов выполнены из золота, циферблаты из титана, а женские часы украшены бриллиантами. Если Вы хотите приобрести эксклюзивные часы известного бренда, которые будут уникальны, надежны и точны, то несомненно, Jaquet Droz это часы для Вас.</span></span></p>
 
